$.getScript('assets/js/jquery.min.js',function(){var didScroll;var lastScrollTop=0;var delta=5;var navbarHeight=$('landing-navbar').outerHeight();$(window).scroll(function(event){didScroll=!0});setInterval(function(){if(didScroll){hasScrolled();didScroll=!1}},200);function hasScrolled(){var st=$(this).scrollTop();if(Math.abs(lastScrollTop-st)<=delta)
return;if(st>lastScrollTop&&st>navbarHeight){$('landing-navbar').removeClass('navbar-slider').addClass('landing-navbar-up')}else{if(st+$(window).height()<$(document).height()){$('landing-navbar').removeClass('landing-navbar-up').addClass('navbar-slider')}}
lastScrollTop=st}})